          this.CalculateFaceLocation(response);

        },
        function (reject) {
          console.log(reject);
        }
      );
  }

  render() {
    return (
      <div className="App">

        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkFrom oninputchange={this.oninputchange} onbuttonsubmit={this.onbuttonsubmit} />
